 const FormValues =(props)=>{
    render() 
        return (
            <div>
                <p>
                fName={props.fName} 
          lNam{props.lName} 
          age{props.age} 
          gender {props.gender} 
          destination {props.destination}
          nutsFree:{props.nutsFree}
          lactoseFree:{props.lactoseFree}
          vegan: {props.vegan}
          </p>
            </div>
        )

    }

export default FormValues
